import SVGElement from 'happy-dom/lib/nodes/svg-element/SVGElement';
import DOMRect from 'happy-dom/lib/nodes/element/DOMRect';
import DOMMatrix from 'happy-dom/lib/nodes/svg-element/DOMMatrix';
import ISVGGraphicsElement from 'happy-dom/lib/nodes/svg-element/ISVGGraphicsElement';
/**
 * SVG Graphics Element.
 *
 * @see https://developer.mozilla.org/en-US/docs/Web/API/SVGGraphicsElement
 */
export default class SVGGraphicsElement extends SVGElement implements ISVGGraphicsElement {
    readonly transform: {};
    /**
     * Returns DOM rect.
     *
     * @returns DOM rect.
     */
    getBBox(): DOMRect;
    /**
     * Returns CTM.
     *
     * @returns CTM.
     */
    getCTM(): DOMMatrix;
    /**
     * Returns screen CTM.
     *
     * @returns Screen CTM.
     */
    getScreenCTM(): DOMMatrix;
}
